@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'SecondAngularProject';
  hero = 'Drogfisher'

  onLike() {
    window.alert(`I like ${this.hero}`)
    this.hero = 'Boothstomper';
  }
}
